eval("__webpack_require__.r(__webpack_exports__);\n/* harmony default export */ __webpack_exports__[\"default\"] = ([{\n  question: \"Providing Liquidity Introduction :\",\n  answer: \"When providing liquidity from a smart contract, the most important thing to keep in mind is that tokens deposited into a pool at any rate other than the current reserve ratio are vulnerable to being arbitraged. As an example, if the ratio of x:y in a pair is 10:2 (i.e. the price is 5), and someone naively adds liquidity at 5:2 (a price of 2.5), the contract will simply accept all tokens (changing the price to 3.75 and opening up the market to arbitrage), but only issue pool tokens entitling the sender to the amount of assets sent at the proper ratio, in this case 5:1. To avoid donating to arbitrageurs, it is imperative to add liquidity at the current price. Luckily, it’s easy to ensure that this condition is met!\"\n}, {\n  question: \"Using the Router\",\n  answer: \"The easiest way to safely add liquidity to a pool is to use the router, which provides simple methods to safely add liquidity to a pool. If the liquidity is to be added to an ERC-20/ERC-20 pair, use addLiquidity. If WETH is involved, use addLiquidityETH.These methods both require the caller to commit to a belief about the current price, which is encoded in the amount*Desired parameters. Typically, it’s fairly safe to assume that the current fair market price is around what the current reserve ratio is for a pair (because of arbitrage). So, if a user wants to add 1 ETH to a pool, and the current DAI/WETH ratio of the pool is 200/1, it’s reasonable to calculate that 200 DAI must be sent along with the ETH, which is an implicit commitment to the price of 200 DAI/1 WETH. However, it’s important to note that this must be calculated before the transaction is submitted. It is not safe to look up the reserve ratio from within a transaction and rely on it as a price belief, as this ratio can be cheaply manipulated to your detriment.However, it is still possible to submit a transaction which encodes a belief about the price which ends up being wrong because of a larger change in the true market price before the transaction is confirmed. For that reason, it’s necessary to pass an additional set of parameters which encode the caller’s tolerance to price changes. These amount*Min parameters should typically be set to percentages of the calculated desired price. So, at a 1% tolerance level, if our user sends a transaction with 1 ETH and 200 DAI, amountETHMin should be set to e.g. .99 ETH, and amountTokenMin should be set to 198 DAI. This means that, at worst, liquidity will be added at a rate between 198 DAI/1 ETH and 202.02 DAI/1 ETH (200 DAI/.99 ETH).Once the price calculations have been made, it’s important to ensure that your contract a) controls at least as many tokens/ETH as were passed as amount*Desired parameters, and b) has granted approval to the router to withdraw this many tokens.\"\n}, {\n  question: \"Pools Introduction :\",\n  answer: \"Each Uniswap liquidity pool is a trading venue for a pair of ERC20 tokens. When a pool contract is created, its balances of each token are 0; in order for the pool to begin facilitating trades, someone must seed it with an initial deposit of each token. This first liquidity provider is the one who sets the initial price of the pool. They are incentivized to deposit an equal value of both tokens into the pool. To see why, consider the case where the first liquidity provider deposits tokens at a ratio different from the current market rate. This immediately creates a profitable arbitrage opportunity, which is likely to be taken by an external party.When other liquidity providers add to an existing pool, they must deposit pair tokens proportional to the current price. If they don’t, the liquidity they added is at risk of being arbitraged as well. If they believe the current price is not correct, they may arbitrage it to the level they desire, and add liquidity at that price.\"\n}, {\n  question: \"Pool tokens\",\n  answer: \"Whenever liquidity is deposited into a pool, unique tokens known as liquidity tokens are minted and sent to the provider’s address. These tokens represent a given liquidity provider’s contribution to a pool. The proportion of the pool’s liquidity provided determines the number of liquidity tokens the provider receives. If the provider is minting a new pool, the number of liquidity tokens they will receive will equal sqrt(x * y), where x and y represent the amount of each token provided.Whenever a trade occurs, a 0.3% fee is charged to the transaction sender. This fee is distributed pro-rata to all LPs in the pool upon completion of the trade.To retrieve the underlying liquidity, plus any fees accrued, liquidity providers must “burn” their liquidity tokens, effectively exchanging them for their portion of the liquidity pool, plus the proportional fee allocation.As liquidity tokens are themselves tradable assets, liquidity providers may sell, transfer, or otherwise use their liquidity tokens in any way they see fit.\"\n}, {\n  question: \"Fees\",\n  answer: \"Liquidity provider feesThere is a 0.3% fee for swapping tokens. This fee is split by liquidity providers proportional to their contribution to liquidity reserves.Swapping fees are immediately deposited into liquidity reserves. This increases the value of liquidity tokens, functioning as a payout to all liquidity providers proportional to their share of the pool. Fees are collected by burning liquidity tokens to remove a proportional share of the underlying reserves.Since fees are added to liquidity pools, the invariant increases at the end of every trade. Within a single transaction, the invariant represents token0_pool / token1_pool at the end of the previous transaction.There are many community developed tools to determine returns. You can also read more in the docs about how to think about LP returns.Protocol Fees: At the moment there are no protocol fees. However, it is possible for a 0.05% fee to be turned on in the future.More information about a potential future protocol fee can be found here.Protocol Charge Calculation: In the future, it is possible that a protocol-wide charge of 0.05% per trade will take effect. This represents ⅙th (16.6̅%) of the 0.30% fee. The fee is in effect if feeTo is not address(0) (0x0000000000000000000000000000000000000000), indicating that feeTo is the recipient of the charge.This amount would not affect the fee paid by traders, but would affect the amount received by liquidity providers.Rather than calculating this charge on swaps, which would significantly increase gas costs for all users, the charge is instead calculated when liquidity is added or removed. See the whitepaper for more details.\"\n}, {\n  question: \"Security (Audit & Formal Verification)\",\n  answer: \"Between January 8 and April 30, a team of six engineers reviewed and formally verified crucial components of the smart contracts for Genesis Farming.Their past work includes smart contract development on and formal verification of multi-collateral DAI.The scope of work includes: Formal verification of the core smart contracts, code review of core smart contracts, numerical error analysis, code review of periphery smart contracts (during ongoing development).\"\n}, {\n  question: \"Est-ce que mon application sera 'native'?\",\n  answer: \"Oui, nous ne pensons pas que les applications dites 'hybrides' soient d'une qualité suffisante pour offrir la meilleure expérience posssible à vos utilisateurs. C'est pourquoi nous utilisons un rendu 'natif' qui offre la même qualité qu'Instagram, Pinterest, Facebook, ...\"\n}, {\n  question: \"Est-ce que mon projet pourra accueillir des milliers/millions d'utilisateurs?\",\n  answer: \"Oui, nous pensons la structure de votre application dès le début pour qu'elle puisse s'adapter à une forte croissance sans perte de performances.\"\n}, {\n  question: \"Comment est-ce que je pourrai gérer mon projet?\",\n  answer: \"Nous livrons nos clients avec une solution clé en main qui leur permet de consulter les statistiques principales de leur projet (revenus, utilisateus actifs, fidélisation, géolocalisation des utilisateurs, ...), d'envoyer des notifications personnalisées, de modérer les comportements inadaptés mais aussi de gérer leurs campagnes marketing.\"\n}, {\n  question: \"Combien coûte l'hébergement?\",\n  answer: \"Pour démarrer, comptez vingt cinq euros mensuels pour plusieurs dizaines de milliers d'utilisateurs. Ensuite, vous payez à l'utilisation, le prix est toujours insignifiant par rapport aux revenus générés.\"\n}, {\n  question: \"Combien coûtent les modifications?\",\n  answer: \"Nous ne facturons pas les changements mineurs (moins de deux heures de travail). Pour les nouvelles fonctionnalités plus complexes, le prix dépend du nombre de jours de travail. Vous pouvez demander un devis gratuit à votre chef de projet.\"\n}, {\n  question: \"Que faites-vous pour assurer la sécurité et la confidentialité de mon projet?\",\n  answer: \"Tout d'abord, votre code source est stocké sur notre outil interne crypté. Les équipes ont accès au code uniquement pendant la durée de leur mission. Les salariés qui ne travaillent pas sur votre projet n'ont même pas connaissance de son existence.\"\n}, {\n  question: \"Est-ce que mon application risque de se faire pirater?\",\n  answer: \"Le risque zéro n'existe pas. Cependant, tout est mis en place pour éviter toute tentative de piratage: le code est passé au peigne fin avant chaque mise en production pour s'assurer de l'absence de failles et des règles de sécurité analysent chaque accès à votre base de donnée pour évaluer les risques. Pour nos clients dans la finance (et les cryptomonnaies) nous mettons en place l'identification biométrique, l'authentification à deux facteurs et l'utilisation d'un PIN à quatre caractères avant chaque transaction.\"\n}, {\n  question: \"Combien d'années d'expérience ont vos développeurs?\",\n  answer: \"Nos développeurs ont tous au minimum 10 ans d'expérience en développement.\"\n}, {\n  question: \"Est-ce que vous allez sous-traiter mon projet?\",\n  answer: \"Non, votre projet est réalisé intégralement en interne à Bordeaux par nos équipes. Il n'y a aucune sous-traitance.\"\n}, {\n  question: \"Est-ce que je suis 100% propriétaire du code source?\",\n  answer: \"Oui, le contrat signé en début de mission stipule noir sur blanc que nous vous cédons l'intégralité de la propriété intellectuelle sur le projet.\"\n}, {\n  question: \"Est-ce que vous proposez une assistance à la création d'entreprise?\",\n  answer: \"Oui, votre chef de projet dédié répondra gratuitement à toutes vos questions concernant le choix des statuts, les meilleurs outils (banque, comptabilité, ...) et les aides de l'état qui vous sont disponibles.\"\n}]);//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./data/dataFAQ.js\n");

